function Button() {
  return (
    <div className="buttonOuter">
      <div className="internalButtonContent">
        <p>Add Your Own</p>
      </div>
      <style jsx>{`
        .buttonOuter {
          padding: 5px;
          width: 200px;
          height: 50px;
          background-color: #B775E0;
          box-shadow: 0px 4px 0px #9F0B37;
          border-radius: 20px;
          display: inline-block;
          color: white;
          font-size: 20px;
          font-weight: 600;
          text-align: center;
          vertical-align: center;
        }
      `}</style>
    </div>
  )
}

export default Button
